webpackJsonp([23,47],{760:function(r,n){r.exports="### Array Methods\r\n\r\n#### Methods List\r\n- Array.from\r\n- Array.of\r\n- Array.prototype.fill\r\n- Array.prototype.find\r\n- Array.prototype.findIndex\r\n- Array.prototype.entries\r\n- Array.prototype.keys\r\n- Array.prototype.copyWithin\r\n\r\n\r\n#### `Array.from`\r\n\r\n##### Description\r\nMethod used to create an array from array-like & iterable objects.\r\n\r\n\r\n##### Syntax\r\n```javascript\r\nArray.from( obj,\r\n            mapFunction ?= undefined,\r\n            context ?= enclosing context ) // => array of the provided input\r\n```\r\n\r\n\r\n##### Examples\r\n```javascript\r\nlet\r\n  arrLike  = { 0: 'zero', 1: 'one', length: 2 },\r\n  iterable = 'iterable',\r\n  fn = function () {\r\n    let args = Array.from( arguments );\r\n    console.log( args )\r\n  };\r\n\r\nArray.from( arrLike, (val, idx) => (val += ' in digits ' + idx)) // ['zero in digits 0', 'one in digits 1']\r\nArray.from( iterable )// ['i','t','e','r','a','b','l','e']\r\nfn(1, 2) // [1, 2]\r\n```\r\n\r\n\r\n\r\n#### `Array.of`\r\n\r\n##### Description\r\nMethod used to create an array from its passed arguments regardless of their type.\r\n\r\n\r\n##### Syntax\r\n```javascript\r\nArray.of(elm0[, elem1, ... elemN]) // => array of arguments\r\n```\r\n\r\n\r\n##### Examples\r\n```javascript\r\nArray.of(1, 'string', false, undefined, null, new Date(), {x: 0}, [1]) // [1, \"string\", false, undefined, null, \"3030-01-01:)\", {x:0}, [1]]\r\n```\r\n\r\n\r\n\r\n#### `Array.prototype.fill`\r\n\r\n##### Description\r\nMethod used to change array slots values to the passed value from a starting index to end index.\r\n\r\n\r\n##### Syntax\r\n```javascript\r\narr.fill( val,\r\n          start ?= 0,\r\n          end   ?= arr.length ) // => new filled array\r\n```\r\n\r\n\r\n##### Examples\r\n```javascript\r\n[1, 2, 3].fill(0)           // [0,0,0]\r\n[1, 2, 3].fill(0, 1)        // [1,0,0]\r\n[1, 2, 3].fill(0, 1, 2)     // [1,0,3]\r\n[1, 2, 3].fill(0, -1)       // [1,2,0]\r\n[1, 2, 3].fill(0, -1, -2)   // [1,2,3]\r\n[1, 2, 3].fill(0, -5, -10)  // [1,2,3]\r\n```\r\n\r\n\r\n\r\n#### `Array.prototype.find`\r\n\r\n##### Description\r\nMethod used to find an first element that passes a test function in a given array.\r\n\r\n\r\n##### Syntax\r\n```javascript\r\narr.find( testFN(element, index, arr),\r\n          context ?= undefined ) // => the first matched element value\r\n```\r\n\r\n\r\n##### Examples\r\n```javascript\r\nlet\r\n  arr = [1, 2, 3, 4],\r\n  testFN = (elem) => elem % 2 === 0;\r\n\r\n// find the first even numer in the array\r\narr.find(testFN); // 2\r\n```\r\n\r\n\r\n\r\n#### `Array.prototype.findIndex`\r\n\r\n##### Description\r\nMethod used to find an first element **index** that passes a test function in a given array.\r\n\r\n\r\n##### Syntax\r\n```javascript\r\narr.findIndex(testFN(element, index, arr),\r\n              context ?= undefined) // => the first matched element value\r\n```\r\n\r\n\r\n##### Examples\r\n```javascript\r\nlet\r\n  arr = [1, 2, 3, 4],\r\n  testFN = (elem) => elem % 2 === 0;\r\n\r\n// find the index of the first even numer in the array\r\narr.findIndex(testFN); // 1\r\n```\r\n\r\n\r\n\r\n#### `Array.prototype.entries`\r\n\r\n##### Description\r\nMethod used to create array iterator from key/value pairs of the provided array.\r\n\r\n\r\n##### Syntax\r\n```javascript\r\narr.entries() // => Array Iterator\r\n```\r\n\r\n\r\n##### Examples\r\n```javascript\r\nlet it = [1, 2, 3, 4].entries();\r\nit.next().value; // [0, 1]\r\nit.next().value; // [1, 2]\r\nit.next().value; // [2, 3]\r\nit.next().value; // [3, 4]\r\n```\r\n\r\n\r\n\r\n#### `Array.prototype.keys`\r\n\r\n##### Description\r\nMethod used to create array iterator from indexes of the provided array.\r\n\r\n\r\n##### Syntax\r\n```javascript\r\narr.keys() // => Array Iterator\r\n```\r\n\r\n\r\n##### Examples\r\n```javascript\r\nlet it = [1, 2, 3, 4].keys();\r\nit.next().value; // 0\r\nit.next().value; // 1\r\nit.next().value; // 2\r\nit.next().value; // 3\r\n```\r\n\r\n\r\n\r\n#### `Array.prototype.copyWithin`\r\n\r\n##### Description\r\nMethod used to copy array or array-like elements from one position to another inside the same array.\r\n\r\n\r\n##### Syntax\r\n```javascript\r\narr.copyWithin( targetIndex,\r\n                start ?= 0,\r\n                end ?= arr.length ) // => new formated array\r\n```\r\n\r\n\r\n##### Examples\r\n```javascript\r\nlet\r\n  arr = [1, 2, 3, 4, 5],\r\n  arrLike = { 0: 1, 1: 2, 2: 3, length: 3 }\r\n\r\narr.copyWithin(0, 3) // => [4, 5, 3, 4, 5]\r\n[].copyWithin.call(arrLike, 0, 2) // => { 0: 3, 1: 2, 2: 3, length: 3 }\r\n```\r\n"},90:function(r,n,e){"use strict";(function(r){function t(r){return r&&r.__esModule?r:{default:r}}Object.defineProperty(n,"__esModule",{value:!0}),n.default=void 0;var a=t(e(2)),i=t(e(221)),o=t(e(57)),s=t(e(760));!function(){var n=e(1).enterModule;n&&n(r)}();var l=function(){return a.default.createElement(o.default,null,a.default.createElement("div",{id:"post"},a.default.createElement("hgroup",{className:"mB-60"},a.default.createElement("h5",{className:"c-minor"},"Jul 30, 2017"),a.default.createElement("h1",{className:"c-blocker"},"ES6 Overview - Array Methods"),a.default.createElement("hr",null)),a.default.createElement(i.default,{source:s.default})))},d=l,f=d;n.default=f,function(){var n=e(1).default,t=e(1).leaveModule;n&&(n.register(l,"Es6OverviewArrayMethods","E:\\personal-website\\src\\screens\\Blog\\components\\Es6OverviewArrayMethods\\index.jsx"),n.register(d,"default","E:\\personal-website\\src\\screens\\Blog\\components\\Es6OverviewArrayMethods\\index.jsx"),t(r))}()}).call(n,e(7)(r))}});